import { Container, Typography } from "@mui/material";
import { Box, Stack } from "@mui/system";
import React from "react";

const BrandFilter = () => {
  return (
    <Container>
      <Stack>
        <Box>
          <Typography variant="h1">Brand Filter</Typography>
        </Box>
      </Stack>
    </Container>
  );
};

export default BrandFilter;
